Dalam rangka menjaga stabilitas keamanan dan ketertiban masyarakat (kamtibmas), Polres Bojonegoro bersama Polsek jajaran terus mengintensifkan kegiatan patroli Birukan Bojonegoro, Selasa (17/6/2025).

Kapolres Bojonegoro AKBP Mario Prahatinto, S.H., S.I.K., M.Si. mengatakan bahwa patroli ini sebagai bentuk kesiapsiagaan Polri dalam menciptakan rasa aman bagi masyarakat, terutama pada malam hingga dini hari.

"Kegiatan patroli Pleton Siaga ini dilaksanakan rutin dan berkelanjutan. Tujuannya adalah untuk menekan potensi gangguan kamtibmas serta memastikan kehadiran polisi dirasakan langsung oleh masyarakat," ujar Kapolres.

