Kapolres Bojonegoro AKBP Mario Prahatinto, S.H., S.I.K., M.Si., resmi membuka kejuaraan Futsal kapolres bojonegoro Cup 2025 antar personel dalam rangka Hari Bhayangkara ke-79 yang berlangsung di Gor Dabonsia di Desa Ngumpakdalem, Kecamatan Dander, Kabupaten Bojonegoro, Selasa (17/6/2025).

Turnamen futsal ini diikuti oleh puluhan tim yang terdiri dari personel Polres, Polsek jajaran. Ajang ini menjadi momentum mempererat silaturahmi, meningkatkan soliditas, serta menumbuhkan jiwa sportivitas antar peserta.

Kejuaraan Futsal Kapolres Cup 2025 ini merupakan bagian dari rangkaian peringatan Hari Bhayangkara ke-79. Selain cabang futsal, sejumlah kegiatan olahraga dan sosial lainnya juga diselenggarakan guna menyemarakkan peringatan hari bersejarah bagi institusi Polri tersebut.

