Kejuaraan Futsal Kapolres Bojonegoro Cup 2025 resmi dimulai setelah digelarnya upacara pembukaan yang dipimpin langsung oleh Kapolres Bojonegoro serta berlangsung penuh semangat dan sangat meriah di GOR Dabonsia Bojonegoro, Selasa (17/6/2025).

Dalam sambutannya, Kapolres Bojonegoro menyampaikan bahwa turnamen ini bukan hanya ajang untuk menunjukkan kemampuan di lapangan, tetapi juga sebagai sarana mempererat tali silaturahmi, memperkuat sinergi, serta menumbuhkan semangat sportivitas di kalangan peserta.

“Melalui turnamen ini, kami ingin menjadikan olahraga sebagai wadah positif dalam membangun kebersamaan dan menjunjung tinggi fair play,” ujar Kapolres.

Usai pembukaan, laga perdana langsung digelar dan disaksikan antusias oleh para penonton yang memadati tribun. Suasana kompetitif dan semangat juang dari para pemain menjadikan pertandingan pembuka berlangsung seru dan menghibur.

