Penyerahan Piala Kejuaraan Pencak Silat Kapolres Cup 2025

Kapolres Bojonegoro AKBP Mario Prahatinto, SH, SIK, M.Si secara resmi menutup Kejuaraan Pencak Silat Kapolres Bojonegoro Cup 2025 dengan menyerahkan piala dan piagam penghargaan kepada para juara di GOR Polres Bojonegoro, yang dihadiri Pejabat Utama Polres, Ketua IPSI, Ketua Bojonegoro Kampung Pesilat, serta para ketua perguruan silat Kabupaten Bojonegoro, Senin (16/6/2025).

Kejuaraan ini bukan hanya ajang mencari juara, tetapi menjadi ruang pembinaan karakter, sportivitas, dan silaturahmi antar generasi muda pencinta pencak silat di Bojonegoro. Terima kasih atas semangat dan dedikasi semua peserta.

