Penyerahan Piala Kejuaraan Pencak Silat Kapolres Cup 2025

Bojonegoro – Kapolres Bojonegoro AKBP Mario Prahatinto, SH, SIK, M.Si, secara resmi menutup Kejuaraan Pencak Silat Kapolres Bojonegoro Cup 2025 dengan menyerahkan piala dan piagam penghargaan kepada para juara, Senin (16/6/2025) di GOR Polres Bojonegoro. Kegiatan ini dihadiri oleh Pejabat Utama Polres, Ketua IPSI, Ketua Bojonegoro Kampung Pesilat, serta para ketua perguruan silat se-Kabupaten Bojonegoro. Dalam sambutannya, Kapolres mengapresiasi semangat sportivitas peserta dan menekankan bahwa kejuaraan ini menjadi media pembinaan karakter dan silaturahmi antarperguruan.

PSHT keluar sebagai juara umum dengan tujuh medali emas, disusul Pagar Nusa di posisi kedua, dan Pencak Organisasi di tempat ketiga. Sementara di kategori seni beregu, BKP Kalitidu meraih juara pertama. Ketua PSHT, Wahyu Subakdiono, turut mengapresiasi peran Polres dalam memberikan ruang positif bagi generasi muda untuk berkembang melalui pencak silat.

