Kolaborasi Seni Antar Perguruan Silat Warnai Kapolres Cup 2025

Penampilan seni regu campuran dalam Kejuaraan Pencak Silat Kapolres Bojonegoro Cup 2025 menghadirkan kolaborasi dari berbagai perguruan silat yang tergabung dalam Bojonegoro Kampung Pesilat (BKP) di tiap ranting atau kecamatan. Para pesilat menunjukkan kekompakan dan semangat kebersamaan. Kegiatan ini berlangsung di GOR Polres Bojonegoro, Senin (16/6/2025).

Lewat seni regu campuran ini, kita ingin tunjukkan bahwa perbedaan perguruan bukanlah batas, melainkan kekuatan dalam menjaga warisan budaya dan persaudaraan sesama pesilat.

